const MobileFriendlyNav = ({callBack}) => {
    const navbarRef = useRef(null)

    function useWindowSize() {
        // Initialize state with undefined width/height so server and client renders match
        // Learn more here: https://joshwcomeau.com/react/the-perils-of-rehydration/
        const [windowSize, setWindowSize] = useState({
          width: undefined,
          height: undefined,
        });
        useEffect(() => {
          // Handler to call on window resize
          function handleResize() {
            // Set window width/height to state
            setWindowSize({
              width: window.innerWidth,
              height: window.innerHeight,
            });
          }
          // Add event listener
          window.addEventListener("resize", handleResize);
          // Call handler right away so state gets updated with initial window size
          handleResize();
          // Remove event listener on cleanup
          return () => window.removeEventListener("resize", handleResize);
        }, []); // Empty array ensures that effect is only run on mount
        return windowSize;
      }
      const size = useWindowSize();

    return(
        <Navbar fixed="top" bg="light" expand="lg" style={{color: "black", fontFamily: "Bungee Inline", zIndex:100, padding: "1vw 15vw 1vw 15vw",}}
            ref={navbarRef}
        >
        <Container fluid>
            <Div mr5><Logo fill={"black"} width={50} height={50}></Logo></Div>
            {size.width &&  size.width > 400 && <Navbar.Brand href="#home">
                BearDom
            </Navbar.Brand>}
            <Navbar.Toggle aria-controls="basic-navbar-nav" />
            <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="me-auto">
                <Nav.Link href="#about" onClick={() => callBack(0)}>About</Nav.Link>
                <Nav.Link href="#rarity" onClick={() => callBack(1)}>Rarity</Nav.Link>
                <Nav.Link href="#reroll" onClick={() => callBack(2)}>Re-Roll</Nav.Link>
                <Nav.Link href="#carp" onClick={() => callBack(3)}>C.A.R.P</Nav.Link>
                <Nav.Link href="#team" onClick={() => callBack(4)}>Team</Nav.Link>
                <Nav.Link href="#faq" onClick={() => callBack(5)}>FAQ</Nav.Link>
            </Nav>
            </Navbar.Collapse>
        </Container>
        </Navbar>
    )
}
 
